import React, { Component } from "react";
import DropdownButton from "react-bootstrap/DropdownButton";
import Dropdown from "react-bootstrap/Dropdown";

import "./SearchBar.css";
const SearchBar = ({ inputGotChanged }) => {
  return (
    <div className="SearchBar">
      <input
        type="search"
        placeholder="search for character"
        onChange={inputGotChanged}
      />
      <DropdownButton
        id="dropdown-basic-button"
        title="Sort By"
        onSelect={console.log("ye")}
      >
        <Dropdown.Item href="#/action-1">Popularity (default)</Dropdown.Item>
        <Dropdown.Item href="#/action-2">Name</Dropdown.Item>
        <Dropdown.Item href="#/action-3">Height</Dropdown.Item>
        <Dropdown.Item href="#/action-3">Weight</Dropdown.Item>
      </DropdownButton>
    </div>
  );
};

export default SearchBar;
